import "./App.css";
import Tesseract from "tesseract.js";

const loadData = async () => {
  const result = await Tesseract.recognize(
    "https://tesseract.projectnaptha.com/img/eng_bw.png",
    "eng"
  );

  console.log(result);
};

loadData();

function App() {
  return <div className="App"></div>;
}

export default App;
